// We used to fetch this Lato Bold font from /fonts/lato/extended/Lato-Bold.woff2
// on the fly each time we created an icon. Instead of doing that, we are storing
// the base64 encoded version of the font file's contents

// If we want to change or update the font, we can recreate it doing something like
// fetch(<FONT URL>).then(data => data.blob()).then(blob => convertFileToBase64(blob))

const base64EncodedFont = () =>
  `data:application/octet-stream;base64,`

export default base64EncodedFont
